import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import { useNavigate, useParams } from 'react-router-dom';
import { useAuthr } from '../Login/peticion';



function Profile(){
    const auth=useAuthr();
    const {slug} = useParams();
    const navigate= useNavigate();
    console.log("un profile",auth.user)
    function lectura(e){
        console.log(e.target.outerText)
    }

    console.log(slug)
    return(
    <Container>
        <Row>
            <Col>
            <ul class="list-group w-50">
            <li onClick={lectura} name="information" class="list-group-item bg-dark text-light active">Information</li>
            <li onClick={lectura} class="list-group-item bg-dark text-light" >Change password</li>
            <li onClick={lectura} class="list-group-item bg-dark text-light">Delete courses</li>  
            <li onClick={lectura} class="list-group-item bg-dark text-light">Drop out</li>
            <li onClick={()=>{auth.logout()}} class="list-group-item bg-dark text-light">Logout</li>
          
            </ul>
            </Col>

            <Col>
            <h2>Lado b </h2>
            </Col>
        </Row>
    </Container>
    )
}

export {Profile}
